func checkPortIP(ip string, port int) string {
    target := fmt.Sprintf("%s:%d", ip, port)
    timeout := time.Duration(1 * time.Second)

    conn, err := net.DialTimeout("tcp", target, timeout)

    if err != nil {
        return fmt.Sprintf("Port %d: CLOSED", port)
    }

